import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  const expenses = props.items.array.forEach((element) => {
      <ExpenseItem
        title={element.title}
        amount={element.amount}
        date={element.date}
      />;
    });

  return <div className="expenses">{expenses}</div>;
}
export default Expenses;
